import axios from 'axios';

export const getAllCharacters = async () => {
  const response = await axios
        .get('https://rickandmortyapi.com/api/character');
    const { data } = response;
    return data;
};

export const fetchPrevious = async (url) => {
  const prevData = await axios
  .get(url)
}
